const PlasmicDescendants = {
  root: ["root", "svg", "checkbox", "getTask", "lottie", "getInfo"],
  svg: ["svg"],
  checkbox: ["checkbox"],
  getTask: ["getTask", "lottie"],
  lottie: ["lottie"],
  getInfo: ["getInfo"]
} as const;
type NodeNameType = keyof typeof PlasmicDescendants;
type DescendantsType<T extends NodeNameType> =
  (typeof PlasmicDescendants)[T][number];
type NodeDefaultElementType = {
  root: "div";
  svg: "svg";
  checkbox: typeof AntdCheckbox;
  getTask: typeof ApiRequest;
  lottie: typeof LottieWrapper;
  getInfo: typeof ApiRequest;
};

type ReservedPropsType = "variants" | "args" | "overrides";
type NodeOverridesType<T extends NodeNameType> = Pick<
  PlasmicPregnancy__OverridesType,
  DescendantsType<T>
>;
type NodeComponentProps<T extends NodeNameType> =
  // Explicitly specify variants, args, and overrides as objects
  {
    variants?: PlasmicPregnancy__VariantsArgs;
    args?: PlasmicPregnancy__ArgsType;
    overrides?: NodeOverridesType<T>;
  } & Omit<PlasmicPregnancy__VariantsArgs, ReservedPropsType> & // Specify variants directly as props
    /* Specify args directly as props*/ Omit<
      PlasmicPregnancy__ArgsType,
      ReservedPropsType
    > &
    /* Specify overrides for each element directly as props*/ Omit<
      NodeOverridesType<T>,
      ReservedPropsType | VariantPropType | ArgPropType
    > &
    /* Specify props for the root element*/ Omit<
      Partial<React.ComponentProps<NodeDefaultElementType[T]>>,
      ReservedPropsType | VariantPropType | ArgPropType | DescendantsType<T>
    >;

function makeNodeComponent<NodeName extends NodeNameType>(nodeName: NodeName) {
  type PropsType = NodeComponentProps<NodeName> & { key?: React.Key };
  const func = function <T extends PropsType>(
    props: T & StrictProps<T, PropsType>
  ) {
    const { variants, args, overrides } = React.useMemo(
      () =>
        deriveRenderOpts(props, {
          name: nodeName,
          descendantNames: PlasmicDescendants[nodeName],
          internalArgPropNames: PlasmicPregnancy__ArgProps,
          internalVariantPropNames: PlasmicPregnancy__VariantProps
        }),
      [props, nodeName]
    );
    return PlasmicPregnancy__RenderFunc({
      variants,
      args,
      overrides,
      forNode: nodeName
    });
  };
  if (nodeName === "root") {
    func.displayName = "PlasmicPregnancy";
  } else {
    func.displayName = `PlasmicPregnancy.${nodeName}`;
  }
  return func;
}

function withUsePlasmicAuth<P extends object>(
  WrappedComponent: React.ComponentType<P>
) {
  const WithUsePlasmicAuthComponent: React.FC<P> = props => {
    const dataSourceCtx = usePlasmicDataSourceContext() ?? {};
    const { isUserLoading, user, token } = plasmicAuth.usePlasmicAuth({
      appId: "suVPi77vb6vv9K5rYJwyxC"
    });

    return (
      <PlasmicDataSourceContextProvider__
        value={{
          ...dataSourceCtx,
          isUserLoading,
          userAuthToken: token,
          user
        }}
      >
        <WrappedComponent {...props} />
      </PlasmicDataSourceContextProvider__>
    );
  };
  return WithUsePlasmicAuthComponent;
}

export const PlasmicPregnancy = Object.assign(
  // Top-level PlasmicPregnancy renders the root element
  withUsePlasmicAuth(makeNodeComponent("root")),
  {
    // Helper components rendering sub-elements
    svg: makeNodeComponent("svg"),
    checkbox: makeNodeComponent("checkbox"),
    getTask: makeNodeComponent("getTask"),
    lottie: makeNodeComponent("lottie"),
    getInfo: makeNodeComponent("getInfo"),

    // Metadata about props expected for PlasmicPregnancy
    internalVariantProps: PlasmicPregnancy__VariantProps,
    internalArgProps: PlasmicPregnancy__ArgProps,

    // Page metadata
    pageMetadata: {
      title: "",
      description: "",
      ogImageSrc: "",
      canonical: ""
    }
  }
);

